text:
Two things are really difficult in life.

Hello for the first time to an unknown person &amp;
Goodbye for the last time to whom we really love.

Eid Mubarak! 
May our fasts and prayers be fully accepted;
may Allah shower his love, mercy, blessings, and guidance upon us all. Ameen.

Speak in such a way that others love to listen u,
&amp;
Listen in such a way that others love to speak with you..!
